const PhoneSingle =({ img })=>{
    const { isMobile } = useIsMobile()
    return(
        <div className="wp-phone-single flex-col-center-center">
            <PhoneUI sizeInPercent={isMobile ? 60 : 30} img={img} />
        </div>
    )
}
const PhoneDouble =({ img1, img2 })=>{
    const { isMobile } = useIsMobile()
    const [img1Size, setImg1Size] = useState(isMobile ? 45 : 30)
    const [img2Size, setImg2Size] = useState(isMobile ? 40 : 25)
    const handleImg1MouseOver =()=>{
        setImg1Size(isMobile ? 45 : 30)
        setImg2Size(isMobile ? 40 : 25)
    }
    const handleImg2MouseOver =()=>{
        setImg1Size(isMobile ? 40 : 25)
        setImg2Size(isMobile ? 45 : 30)
    }
    return(
        <div className="wp-phone-double flex-row-center-center">
            <PhoneUI options={ {onClick: handleImg1MouseOver} } sizeInPercent={img1Size} img={img1} />
            <PhoneUI options={{onClick: handleImg2MouseOver}} sizeInPercent={img2Size} img={img2} />
        </div>
    )
}
const PhoneTriple =({ img1, img2, img3 })=>{
    const { isMobile } = useIsMobile()
    const [img1Size, setImg1Size] = useState(isMobile ? 30 : 15)
    const [img2Size, setImg2Size] = useState(isMobile ? 45 : 30)
    const [img3Size, setImg3Size] = useState(isMobile ? 30 : 15)
    const handleImg1MouseOver =()=>{
        setImg1Size(isMobile ? 45 : 30)
        setImg2Size(isMobile ? 30 : 15)
        setImg3Size(isMobile ? 30 : 15)
    }
    const handleImg2MouseOver =()=>{
        setImg1Size(isMobile ? 30 : 15)
        setImg2Size(isMobile ? 45 : 30)
        setImg3Size(isMobile ? 30 : 15)
    }
    
    const handleImg3MouseOver =()=>{
        setImg1Size(isMobile ? 30 : 15)
        setImg2Size(isMobile ? 30 : 15)
        setImg3Size(isMobile ? 45 : 30)
    }
    return(
        <div className="wp-phone-triple flex-row-center-center">
            <PhoneUI options={ {onClick: handleImg1MouseOver} } sizeInPercent={img1Size} img={img1} />
            <PhoneUI options={{onClick: handleImg2MouseOver}} sizeInPercent={img2Size} img={img2} />
            <PhoneUI options={{onClick: handleImg3MouseOver}} sizeInPercent={img3Size} img={img3} />
        </div>
    )
}
const CompSingle =({ img })=>{
    const { isMobile } = useIsMobile()
    return(
        <CompUI sizeInPercent={isMobile ? 100 : 90} img={img} />
    )
}
const CompDouble =({ img1, img2 })=>{
    const { isMobile } = useIsMobile()
    const [img1Size, setImg1Size] = useState(isMobile ? 80 : 70)
    const [img2Size, setImg2Size] = useState(isMobile ? 50 : 30)
    const [image1Active, setImage1Active] = useState(true);

    const handleImg1MouseOver =()=>{
        setImg1Size(isMobile ? 80 : 70)
        setImg2Size(isMobile ? 50 : 30)
        setImage1Active(true)
    }
    const handleImg2MouseOver =()=>{
        setImg1Size(isMobile ? 50 : 30)
        setImg2Size(isMobile ? 80 : 70)
        setImage1Active(false)
    }
    return(
        <div className="wp-comp-double flex-row-center-center">
            <CompUI options={ {onClick: handleImg1MouseOver, className: image1Active ? 'active' : 'inactive' } } sizeInPercent={img1Size} img={img1} />
            <CompUI options={{onClick: handleImg2MouseOver, className: image1Active ? 'inactive' : 'active' } } sizeInPercent={img2Size} img={img2} />
        </div>
    )
}
const CompTriple =({ img1, img2, img3 })=>{
    const { isMobile } = useIsMobile()
    const [img1Size, setImg1Size] = useState(isMobile ? 30 : 30)
    const [img2Size, setImg2Size] = useState(isMobile ? 80 : 60)
    const [img3Size, setImg3Size] = useState(isMobile ? 30 : 30)
    
    const [activeImage, setActiveImage] = useState(1);


    const handleImg1MouseOver =()=>{
        setImg1Size(isMobile ? 80 : 60)
        setImg2Size(isMobile ? 30 : 30)
        setImg3Size(isMobile ? 30 : 30)
        setActiveImage(1)
    }
    const handleImg2MouseOver =()=>{
        setImg1Size(isMobile ? 30 : 30)
        setImg2Size(isMobile ? 80 : 60)
        setImg3Size(isMobile ? 30 : 30)
        setActiveImage(2)
    }
    
    const handleImg3MouseOver =()=>{
        setImg1Size(isMobile ? 30 : 30)
        setImg2Size(isMobile ? 30 : 30)
        setImg3Size(isMobile ? 80 : 60)
        setActiveImage(3)
    }
    return(
        <div className="wp-comp-triple flex-row-center-center">
            <CompUI options={ {onClick: handleImg1MouseOver, className: activeImage === 1 ? 'active' : 'inactive' } } sizeInPercent={img1Size} img={img1} />
            <CompUI options={{onClick: handleImg2MouseOver, className: activeImage === 2 ? 'active' : 'inactive' }} sizeInPercent={img2Size} img={img2} />
            <CompUI options={{onClick: handleImg3MouseOver, className: activeImage === 3 ? 'active' : 'inactive' }} sizeInPercent={img3Size} img={img3} />
        </div>
    )
}
const PhoneCompSingle =({ pimg, cimg })=>{
    const { isMobile } = useIsMobile()
    return(
        <div className={`wp-phonecomp-single ${isMobile ? "flex-col-center-even" : "flex-row-center-even" }`}>
            <CompUI sizeInPercent={isMobile ? 100 : 75} img={cimg} />
            <PhoneUI sizeInPercent={isMobile ? 30 : 18} img={pimg} />
        </div>
    )
}

