export default function WorkPage() {


    const { workid } = useParams()
    const currentWork = useMemo(() => workData[workid], [])


    useEffect(() => {
        if(!currentWork){
            console.log('Redirect Page')
        }
    }, [currentWork])

    useEffect(() => {
        // window.document.body.scrollTop(0)
        window.scrollTo(0, 0)
    }, [])

    return (
        
            <div className='workpage-container flex-col-center-start'>
                
                {currentWork && <>
                    <br />
                    <img className='logo' src={currentWork.logo} alt="" />
                    <h1 className='title gradient-text'>{currentWork.title}</h1>
                    {currentWork.link && <button className="link"><a href={currentWork.link} target="_blank" rel="noopener noreferrer" >Visit Website</a></button>}
                    <span className="subtitle">{currentWork.subtitle}</span>
                    {currentWork.description}
                    {currentWork && currentWork.gallery.map(el => el)}
                    <br />
                    <br />
                    <span>This website is using different Technologies including: </span>
                    <div className="tech flex-col-center-star">
                        {currentWork && currentWork.tech.map(el => <TechWidget key={el.title} title={el.title} subtitle={el.subtitle} link={el.link} />)}
                    </div>

                    <br />
                </>}
                {!currentWork && <>
                    <h1>Page not Found</h1>
                </>}
            </div>
        
    )
}
